INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0.029, 1, 1, 1, 1.5, 160, 122601, 0, 105, 0, 101);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0.014, 0, 3, 2, 2.5, 120, 122401, 0, 111, 1, 102);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0.017, 0, 2, 3, 2.5, 350, 122501, 1, 105, 0, 103);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0.016, 0, 3, 4, 1.5, 130, 107501, 0, 105, 1, 104);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0.014, 1, 1, 5, 2.5, 160, 107601, 0, 105, 0, 105);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (120, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0.029, 0, 2, 6, 3.5, 255, 107801, 1, 103, 0, 106);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (120, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0.013, 1, 1, 7, 3.5, 160, 110601, 0, 103, 0, 107);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0.014, 0, 2, 8, 2.5, 350, 110401, 1, 103, 0, 108);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0.012, 0, 3, 9, 1.5, 130, 110501, 0, 100, 1, 109);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0.014, 1, 1, 10, 2.5, 200, 115701, 0, 103, 0, 110);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0.071, 0, 2, 11, 2.5, 350, 113601, 1, 103, 0, 111);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (120, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0.014, 0, 3, 12, 1.5, 130, 107901, 0, 103, 1, 112);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0.022, 1, 2, 13, 1.5, 200, 108001, 0, 105, 0, 113);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0.031, 1, 1, 14, 2.5, 160, 110301, 0, 108, 0, 114);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.036, 0, 1, 15, 0.5, 130, 107701, 0, 105, 1, 115);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0.048, 0, 2, 16, 3.5, 350, 113101, 1, 95, 0, 116);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0.043, 0, 3, 17, 1.5, 130, 113301, 0, 105, 1, 117);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0.018, 0, 2, 18, 1.5, 130, 113201, 0, 95, 1, 118);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0.021, 1, 2, 19, 2.5, 160, 117001, 0, 108, 0, 119);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0.036, 0, 1, 20, 2.5, 255, 113501, 1, 105, 0, 120);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0.02, 0, 3, 21, 2.5, 350, 113401, 1, 105, 0, 121);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0.018, 0, 1, 22, 2.5, 130, 110101, 0, 105, 1, 122);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0.03, 1, 3, 23, 3.5, 160, 110001, 0, 111, 0, 123);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0.027, 0, 1, 24, 1.5, 130, 117201, 0, 103, 1, 124);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0.02, 1, 2, 25, 3.5, 160, 117301, 0, 108, 0, 125);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0.04, 0, 3, 26, 2.5, 350, 117401, 1, 105, 0, 126);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0.009, 0, 1, 27, 3.5, 350, 117101, 1, 105, 0, 127);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (120, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0.022, 0, 1, 28, 3.5, 255, 122901, 1, 105, 0, 128);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (110, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0.028, 0, 3, 29, 2.5, 130, 122801, 0, 105, 1, 129);
INSERT INTO `v1_8b5eb77a33173a1c9345a8726ab916378c50845e72b7e60c8ec4ce06392285dc` VALUES (105, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0.023, 1, 2, 30, 3.5, 130, 122701, 0, 108, 0, 130);
